// Pages/Home1.js
import React, { useState, useEffect } from "react";
import axios from "axios";

function Home1() {
  const [osis, setOsis] = useState([]);
  const [name, setName] = useState("");
  const [role, setRole] = useState("");
  const [age, setAge] = useState("");

  useEffect(() => {
    axios.get("http://localhost:5000/api/osis")
      .then(response => setOsis(response.data))
      .catch(error => console.log(error));
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();

    const newOsis = { name, role, age };

    axios.post("http://localhost:5000/api/osis", newOsis)
      .then(response => setOsis([...osis, response.data]))
      .catch(error => console.log(error));

    setName("");
    setRole("");
    setAge("");
  };

  return (
    <div>
      <h1>Data Pengurus OSIS</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="Role"
          value={role}
          onChange={(e) => setRole(e.target.value)}
          required
        />
        <input
          type="number"
          placeholder="Age"
          value={age}
          onChange={(e) => setAge(e.target.value)}
          required
        />
        <button type="submit">Add</button>
      </form>
      <ul>
        {osis.map((o) => (
          <li key={o._id}>{o.name} - {o.role} - {o.age}</li>
        ))}
      </ul>
    </div>
  );
}

export default Home1;
